function swapArray(r,a,o){var t=r[a];r[a]=r[o],r[o]=t}function partition(r,a,o,t){var n=r[t].score;swapArray(r,t,o-1);var s=a,i;for(i=a;o-1>i;++i)r[i].score>=n&&(swapArray(r,s,i),++s);return swapArray(r,o-1,s),s}function qsort(r,a,o){if(o-1>a){var t=a+Math.floor(Math.random()*(o-a));t=partition(r,a,o,t),qsort(r,a,t),qsort(r,t+1,o)}}function quick_sort(r){qsort(r,0,r.length)}